import React from "react";
import "../../App.scss";
import TopBar from "../../components/TopBar/TopBar";
import Footer from "../../components/Footer/Footer";
import "./Contact.scss";

const Contact = () => {
  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData(e.target);
    const data = Object.fromEntries(formData.entries());

    try {
      const response = await fetch("http://localhost:8000/contact/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
      });

      if (!response.ok) {
        throw new Error("Ошибка сети или сервера");
      }
      
      const result = await response.json();
      console.log("Ответ сервера:", result);

      e.target.reset();
    } catch (error) {
      console.error("Ошибка при отправке формы:", error);
    }
  };

  return (
    <>
      <div className="contact-page">
        <TopBar />

        <a href="#search" className="top-bar__search-second contact__search-second">
          <div className="top-bar__search-container-second contact__search-second">
            <div className="top-bar__search-elements-second">
              <div className="top-bar__search-icon-second">
                <img src="/icons/header/search.svg" alt="search" className="top-bar__search-item" />
              </div>
              <div className="top-bar__search-text">Search Model</div>
            </div>
          </div>
        </a>
      </div>

      <main className="main main-contact">
        <section className="contact">
          <h1 className="contact-title">Contact us</h1>

          <div className="contact-content">
            <div className="contact-content__form">
              <form autoComplete="on" id="form" action="#" method="post" onSubmit={handleSubmit} className="contact__message-form">
                <div className="contact__names">
                  <div className="user-name">
                    <label htmlFor="userName" className="form__label">Name*</label>
                    <input type="text" id="userName" className="form__input form__input--name form__input-item" name="userName" placeholder="Enter your name" required />
                  </div>

                  <div className="company-name">
                    <label htmlFor="lastName" className="form__label">Last name*</label>
                    <input type="text" id="lastName" className="form__input form__input--companyName form__input-item" name="lastName" placeholder="Enter your last name" required />
                  </div>
                </div>

                <div className="contact__info">
                  <div className="contact__email">
                    <label htmlFor="email" className="form__label">Email*</label>
                    <input id="email" className="form__input form__input--email" type="email" name="email" placeholder="Enter your email" required />
                  </div>

                  <div className="contact__phone">
                    <label htmlFor="phone" className="form__label">Phone number*</label>
                    <input id="phone" className="form__input form__input--phone form__input-item" type="tel" name="phone" placeholder="Enter your phone number" required />
                  </div>
                </div>

                <div className="contact__message form__control">
                  <label htmlFor="message" className="form__label">Message*</label>
                  <textarea name="message" className="form__input input__textarea" placeholder="Enter your message" required></textarea>
                </div>

                <div className="contact__sent">
                  <div className="contact__policy">
                    <div className="contact-us__policy--text">
                      I agree to receive information from you by email regarding your products and services*
                    </div>

                    <div className="contact__checkbox">
                      <label htmlFor="checkbox" className="contact__checkbox-label">
                        <input className="check-box" type="checkbox" required id="checkbox" />
                        <span className="contact__checkbox-text">I agree</span>
                      </label>
                    </div>
                  </div>

                  <div className="contact__button">
                    <button className="contact__text" type="submit">SUBMIT</button>
                  </div>
                </div>
              </form>
            </div>

            <div className="contact-content__information">
              <div className="contact-content__information-photo">
                <img src="./images/contact/contact-photo.png" alt="contact-photo" />
              </div>
              <div className="contact-content__background"></div>
              <div className="contact-content__information-wrapper">
                <div className="contact-content__information-title">Axiom</div>
                <div className="contact-content__information-discription">
                  It is very important for us to keep in touch with you, so we are always ready to answer any question that interests you. Shoot!
                </div>
              </div>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default Contact;
